20/Feb/24 1:29 PM;557058:2215cb20-664a-4add-921a-fadddeb6bfc8;Hi amigo [~accountid:5a8ffcf35c7a2233512b2393] We are gonna work on the fix.
However let me comment you that P29 has a copy of this report, I don’t know if you remember that P29 required in the past the PCB Move Transaction Custom. Well we will need to apply the same fix in that another report. So Could you help us coordinate the validation of this second report also with P29 plant, when we deploy the fixes?



{color:#0747a6}*Note*{color}{color:#0747a6}: Just to let you know. This report does calls to the implant xml files. Currently these report build the url of the sml file using the configurations done in mesr.sourcer table. Example:{color}

!image-20240220-182238.png|width=779,height=180!

{color:#0747a6}Usually in host_name field they saved just the host name without domain. The mesweb report currently automatically concatenate the “{color}[{color:#0747a6}sanmina.com{color}|http://sanmina.com]{color:#0747a6}“ domain, but nowday there are servers with {color}[{color:#0747a6}42-q.com{color}|http://42-q.com]{color:#0747a6} as a domine for that razon some executions are failed. The fix will consist in don't concatenate the domain anymore, now the configuration in mesr.source table have to save the host name and its domain togheter.{color}



[~accountid:557058:2a899724-d514-45d4-8f31-46d9181d6a69] [~accountid:5d6e87c095fbcc0c341d8ae9] [~accountid:5b34ec24349a91633c1bab89] [~accountid:712020:3047a8e6-79bc-40ca-8ee4-38c1b251880f]

